import React, { Component } from "react";
import styled from "styled-components";

const Qualquer = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  flex-wrap: wrap;
  `;

const TileWrapper = styled.div`
    background-color: white;
    padding: 15px;
    display: flex;
    align-items: center;
    justify-content: center;
    position: relative;
    background-color: red;
   
    width: 800px;
    height: 800px;
    margin: 15px;
     img{
        width:600px;
        height:600px;
    }
    `;

    const TileTypeMiss = styled.div`
    display: flex;
    align-items: center;
    height: 15px;
    width: 40px;
    border-radius: 15px;
    border: 1px solid black;
    color: black;
    
    `;
export default function Details () {
    return (
        <Qualquer>
            <TileWrapper>
                <div><h1>Roubado pela Equipe Rocket</h1></div>
                
            </TileWrapper>
            <div><TileTypeMiss><h3>ola</h3></TileTypeMiss></div>
        </Qualquer>
    )
}
